    false,nt"url": null,nt"notes": "This annual narrative report for Benton
    Lake, Willow Creek, Pishkun outlines Refuge accomplishments during the 1966 calendar
    year.  The report begins by summarizing the weather conditions, habitat conditions,
    water conditions, and food and cover conditions during the year. Wildlife- including
    migratory birds, upland game birds, big game animals, predators, rodents, mammals,
    and raptors- is also covered. The Refuge development and maintenance section discusses
    physical developments, plantings, collections and receipts, and prescribed burning.
    Resource management is outlined; topics include grazing. The public relations section
    of the report describes recreational uses, Refuge visitors, Refuge participation,
    hunting, and safety. Items of interest, N-R forms, and photographs are attached.",nt"license_title":
